import logo from './logo.svg';
import './App.css';
import UserLogin from './components/auth/UserLogin';
import HomePage from './components/HomePage/HomePage';
import { BrowserRouter, Routes, Route, Link, Navigate, useNavigate } from "react-router-dom";
import { AppBar,IconButton,Toolbar,Button,Typography,Box } from "@mui/material";
import authServices from './services/AuthServices';

import Products from './components/HomePage/Products';
import userService from './services/UserService';

function App() {
  const nav = useNavigate();
  return (
    <BrowserRouter>
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h7"  sx={{ flexGrow: 1}}>

             {!authServices.isLogged()? <Link to="/Login" style={{color:"white",paddingRight:"1rem"}}>Login</Link> 
              :<> 
              <Link to="/" style={{color:"white",paddingRight:"1rem"}}>Home</Link>
              <Link to="/products" style={{color:"white",paddingRight:"1rem"}}>Products</Link>              
              <Button variant="contained" color='primary' style={{float:"right",}}  onClick={()=>{
                authServices.logOut();
                window.location.reload();
                nav('/login');

              }}>Logout</Button>
            </>
            }
            </Typography>
          </Toolbar>
        </AppBar>
      </Box>
      <Routes>
        <Route path="/" element={ <HomePage /> } />
        <Route path="/products" element={<Products /> } />
        <Route path="/login" element={ <UserLogin /> } />
                {/* if no route will found new Page will comes  */}
      </Routes>
    </BrowserRouter>



  );
}

export default App;
